import Comparator = require('nashorn/java/util/Comparator');
import Set = require('nashorn/java/util/Set');

declare class SortedSet<E> {
	comparator() : Comparator<any>;
	subSet(arg1 : E, arg2 : E) : SortedSet<E>;
	headSet(arg1 : E) : SortedSet<E>;
	tailSet(arg1 : E) : SortedSet<E>;
	first() : E;
	last() : E;
}


declare interface SortedSet<E> extends Set<E> {}
export = SortedSet
